import React,{Component} from 'react';
import {Header ,Icon, List} from 'semantic-ui-react';
import axios from 'axios';
import { IAdresaF } from '../models/adresaF';


interface IState {
  AdresaF: IAdresaF[]
}

class App extends Component<{}, IState> { //per me i tregu komponentit tone per interfacin IState , {} e shprazet eshte per properties , e dyta per state
  state: IState = {
    AdresaF: []
  };


  componentDidMount(){
    axios.get<IAdresaF[]>('https://localhost:5001/api/AdresaFaturimit').then((response) => { //ktu ja kemi tregu axios se qfare lloji te adreses po kthejm , pra jo any me kon pasi po mundohemi me bo strong typing
    this.setState({
        AdresaF: response.data
    });
    });
  }
  render(){
    return (
      <div>
       <Header as='h2'>
         <Icon name='book'/>
         <Header.Content>LabProjekt</Header.Content>
       </Header>
       <List>
         {this.state.AdresaF.map((adresa) => (
           <List.Item key={adresa.id}>{adresa.emri},{adresa.mbiemri}</List.Item>
         ))}
       </List>
      </div>
    );
  }

}

export default App;
